// src/components/Sidebar.js

import React from 'react';

const Sidebar = ({ addNode }) => {
  return (
    <div className="sidebar">
      <h2>Workflow Editor</h2>
      <button onClick={() => addNode('task', { x: Math.random() * 500, y: Math.random() * 500 })}>
        Add Task
      </button>
      <button onClick={() => addNode('decision', { x: Math.random() * 500, y: Math.random() * 500 })}>
        Add Decision
      </button>
      <button onClick={() => addNode('end', { x: Math.random() * 500, y: Math.random() * 500 })}>
        Add End
      </button>
    </div>
  );
};

export default Sidebar;
